# 임베딩벡터 생성을 위해 사용한 문장
# "트렌드(Trends): 소셜 미디어, 패션, 문화 분야의 최신 유행과 새롭게 떠오르는 패턴들. 바이럴 콘텐츠, 해시태그 운동, 라이프스타일 변화, 최신 시장 동향 등 현대 사회를 형성하는 다양한 흐름을 포함."
# "엔터테인먼트(Entertainment): 즐거움과 여가를 위한 모든 형태의 미디어와 활동. 영화, TV 프로그램, 음악, 게임, 공연, 스트리밍 콘텐츠, 연예인 소식, 디지털 엔터테인먼트 플랫폼 등을 아우름."
# "금융(Finance): 자금, 투자, 경제 문제의 관리와 연구. 개인 재무, 주식 시장, 암호화폐, 은행 서비스, 투자 전략, 경제 뉴스, 재무 설계 조언 등을 다룸."
# "여행(Travel): 여가나 비즈니스를 위한 다양한 장소 탐방과 이동. 여행지 가이드, 여행 팁, 숙박 리뷰, 문화 체험, 교통 수단, 모험 계획 등의 정보를 포함."
# "음식(Food): 요리 예술, 식사 경험, 영양 정보를 다룸. 레시피, 맛집 리뷰, 요리 기술, 식단 가이드라인, 음식 문화, 새로운 미식 트렌드 등을 특징으로 함."
# "IT: 우리 세상을 변화시키는 정보 기술과 디지털 혁신. 소프트웨어 개발, 하드웨어 발전, 사이버 보안, 클라우드 컴퓨팅, 인공지능, 기술 혁신 등을 포함."
# "디자인(Design): 다양한 분야의 창의적 과정과 미적 원칙. 그래픽 디자인, UI/UX, 산업 디자인, 건축, 패션 디자인, 혁신적 디자인 사고 방식 등을 망라."
# "사회(Society): 인간 공동체, 사회적 관계, 문화적 역동성에 대한 연구. 시사 이슈, 사회 문제, 커뮤니티 활동, 문화 현상, 인구 통계 트렌드 등을 다룸."
# "건강(Health): 신체적, 정신적 웰빙 주제와 의료 정보. 피트니스, 영양, 정신 건강, 의학 연구, 웰니스 실천, 의료 시스템, 예방 의학 조언 등을 포함."

